import React from "react";
import { Nav, Form, FormControl, Button, Navbar } from "react-bootstrap";

const Header = props => {
  return (
    <Navbar bg="light" variant="light" collapseOnSelect expand="lg">
      <a class="navbar-brand" href="/">
        <img
          src="https://res.cloudinary.com/justin-bresee/image/upload/v1580358986/Internskip/internskip_logo_x2n2pm.png"
          width="200"
          alt=""
        />
      </a>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="/">Home</Nav.Link>
          <Nav.Link href="/about">About</Nav.Link>
          <Nav.Link href="/login" className="bg-success text-light rounded p-2">
            Login
          </Nav.Link>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-info">Search</Button>
        </Form>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default Header;
